<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Solar Smash Web v72 (Manual WebRTC Multiplayer)</title>
  <style>
    html, body { margin: 0; padding: 0; background: black; overflow: hidden; }
    canvas { display: block; width: 100%; height: 100%; }
    #ui {
      position: fixed; top: 10px; left: 10px; z-index: 10; color: white;
      font-family: Arial, sans-serif; display: flex; flex-direction: column;
      gap: 6px; background: rgba(0,0,0,0.4); padding: 10px; border-radius: 8px;
      max-width: 340px;
    }
    textarea {
      width: 100%;
      height: 80px;
      resize: none;
    }
    button { background: #444; border: none; padding: 6px 10px; color: white;
      cursor: pointer; border-radius: 4px; }
    button.active { background: #e74c3c; }
  </style>
</head>
<body>
  <canvas id="glCanvas"></canvas>
  <div id="ui">
    <button onclick="toggleLocalMultiplayer()">Toggle 2-Player Mode</button>
    <button onclick="startHost()">Host Game</button>
    <textarea id="hostOffer" placeholder="Host Offer (copy this)"></textarea>
    <textarea id="joinAnswer" placeholder="Paste Join Answer here"></textarea>
    <button onclick="submitJoinAnswer()">Submit Answer</button>
    <button onclick="startJoin()">Join Game</button>
    <textarea id="joinOffer" placeholder="Join Offer (copy this)"></textarea>
    <textarea id="hostAnswer" placeholder="Paste Host Answer here"></textarea>
    <button onclick="submitHostAnswer()">Submit Answer</button>
    <button onclick="resetGame()">Reset</button>
  </div>
  <script>
    const canvas = document.getElementById('glCanvas');
    const ctx = canvas.getContext('2d');
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    let stars = [], players = [], particles = [];
    let localMultiplayer = false;
    let pc = null;
    let dataChannel = null;
    let remoteConnected = false;

    // Player controls
    let keys = {};
    window.addEventListener('keydown', (e) => { keys[e.key] = true; });
    window.addEventListener('keyup', (e) => { keys[e.key] = false; });

    function resetGame() {
      stars = generateStars();
      players = generatePlayers();
      particles = [];
    }

    function generateStars() {
      let s = [];
      for (let i = 0; i < 500; i++) {
        s.push({ x: Math.random() * canvas.width, y: Math.random() * canvas.height, radius: Math.random() * 1.5 });
      }
      return s;
    }

    function generatePlayers() {
      return [
        { id: 1, x: 100, y: canvas.height/2, color: 'cyan', score: 0 },
        { id: 2, x: canvas.width - 100, y: canvas.height/2, color: 'orange', score: 0 }
      ];
    }

    function toggleLocalMultiplayer() {
      localMultiplayer = !localMultiplayer;
    }

    // ---------------- WEBRTC HOST ----------------
    async function startHost() {
      pc = new RTCPeerConnection();
      dataChannel = pc.createDataChannel("game");
      dataChannel.onmessage = (e) => handleRemoteData(e.data);
      pc.onicecandidate = (e) => {
        if (e.candidate) return;
        document.getElementById('hostOffer').value = JSON.stringify(pc.localDescription);
      };
      const offer = await pc.createOffer();
      await pc.setLocalDescription(offer);
    }

    async function submitJoinAnswer() {
      const answer = JSON.parse(document.getElementById('joinAnswer').value);
      await pc.setRemoteDescription(answer);
      remoteConnected = true;
    }

    // ---------------- WEBRTC JOIN ----------------
    async function startJoin() {
      pc = new RTCPeerConnection();
      pc.ondatachannel = (e) => {
        dataChannel = e.channel;
        dataChannel.onmessage = (msg) => handleRemoteData(msg.data);
      };
      pc.onicecandidate = (e) => {
        if (e.candidate) return;
        document.getElementById('joinOffer').value = JSON.stringify(pc.localDescription);
      };
      const offer = await pc.createOffer();
      await pc.setLocalDescription(offer);
    }

    async function submitHostAnswer() {
      const answer = JSON.parse(document.getElementById('hostAnswer').value);
      await pc.setRemoteDescription(answer);
      remoteConnected = true;
    }

    function handleRemoteData(data) {
      const obj = JSON.parse(data);
      if (obj.type === 'player') {
        players[1].x = obj.x;
        players[1].y = obj.y;
      }
    }

    function sendPlayerData() {
      if (dataChannel && dataChannel.readyState === 'open') {
        const p = players[0];
        dataChannel.send(JSON.stringify({ type: 'player', x: p.x, y: p.y }));
      }
    }

    // ---------------- GAME ----------------
    function updatePlayers() {
      let p1 = players[0];
      if (keys['w']) p1.y -= 3;
      if (keys['s']) p1.y += 3;
      if (keys['a']) p1.x -= 3;
      if (keys['d']) p1.x += 3;
      if (localMultiplayer) {
        let p2 = players[1];
        if (keys['ArrowUp']) p2.y -= 3;
        if (keys['ArrowDown']) p2.y += 3;
        if (keys['ArrowLeft']) p2.x -= 3;
        if (keys['ArrowRight']) p2.x += 3;
      }
      sendPlayerData();
    }

    function drawPlayers() {
      players.forEach(p => {
        ctx.fillStyle = p.color;
        ctx.beginPath();
        ctx.arc(p.x, p.y, 15, 0, Math.PI * 2);
        ctx.fill();
      });
    }

    function createExplosion(x, y, color) {
      for (let i = 0; i < 20; i++) {
        particles.push({
          x, y, radius: Math.random() * 2 + 1, color,
          dx: (Math.random() - 0.5) * 3, dy: (Math.random() - 0.5) * 3, life: 30 + Math.random() * 20
        });
      }
    }

    function updateParticles() {
      particles.forEach((p, i) => {
        p.x += p.dx;
        p.y += p.dy;
        p.life--;
        if (p.life <= 0) particles.splice(i, 1);
      });
    }

    function drawScene() {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      stars.forEach(star => {
        ctx.fillStyle = 'white';
        ctx.beginPath();
        ctx.arc(star.x, star.y, star.radius, 0, Math.PI * 2);
        ctx.fill();
      });
      drawPlayers();
      particles.forEach(p => {
        ctx.fillStyle = p.color;
        ctx.beginPath();
        ctx.arc(p.x, p.y, p.radius, 0, Math.PI * 2);
        ctx.fill();
      });
    }

    function gameLoop() {
      updatePlayers();
      updateParticles();
      drawScene();
      requestAnimationFrame(gameLoop);
    }

    resetGame();
    gameLoop();
